import { cardStyles } from "../boardStyles";

function Card({card}) {
  return (
    <div style={cardStyles.container}>
      <span style={{display: 'flex', justifyContent: "space-between"}}>
        <h1>{card.title}</h1>
        <p>Date</p>
      </span>
      <hr />
      <p>Description and informationt that is kept within the card</p>
    </div>
  );
}

export default Card;
